        "original_video_url": "https://s3.amazonaws.com/video-api-prod/assets/9f550bfe23674a568b87061e6067ae1a/BFV44247_Dairy-FreePeachTart-FB.mp4",
        "instructions": [
          {
            "start_time": 5833,
            "appliance": null,
            "end_time": 20300,
            "temperature": null,
            "id": 35652,
            "position": 1,
            "display_text": "In a medium bowl, combine the flour, coconut oil, coconut sugar, and salt. Use a flexible spatula to combine the ingredients, mashing the contents thoroughly until a uniform dough forms."
          },
          {
            "end_time": 35766,
            "temperature": null,
            "id": 35653,
            "position": 2,
            "display_text": "Transfer the dough to a floured silicone baking mat. Flour the top of the dough and the rolling pin and begin rolling out the crust into a circle about 12 inches (30 cm) wide. If you do not have a silicone baking mat or other flexible surface, you can roll out the dough between two sheets of plastic wrap.",
            "start_time": 21133,
            "appliance": null
          },
          {
            "position": 3,
            "display_text": "Roll the baking mat and crust onto the rolling pin and transfer to a 10-inch (25-cm) tart pan. Unroll the baking mat over the pan, crust side down, and peel off the baking mat. If the dough is sticking to the baking mat, transfer the baking mat and dough to the fridge for a few minutes, then try transferring the dough to the tart pan again.",
            "start_time": 36599,
            "appliance": null,
            "end_time": 50400,
            "temperature": null,
            "id": 35654
          },
          {
            "appliance": null,
            "end_time": 63033,
            "temperature": null,
            "id": 35655,
            "position": 4,
            "display_text": "Press the crust against the bottom and sides of the tart pan. Roll the rolling pin across the top of the tart pan to cut off any excess dough.",
            "start_time": 50566
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 35656,
            "position": 5,
            "display_text": "Refrigerate the crust for about 20 minutes while you prepare the filling, until the dough has firmed."
          },
          {
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0,
            "temperature": 400,
            "id": 35657,
            "position": 6,
            "display_text": "Preheat the oven to 400°F (200°C)."
          },
          {
            "display_text": "In a medium bowl, combine the coconut oil, coconut sugar, almond flour, arrowroot, cinnamon, and vanilla with an electric hand mixer. Pour in the milk and continue mixing until the filling is thick and well-mixed.",
            "start_time": 65699,
            "appliance": null,
            "end_time": 90500,
            "temperature": null,
            "id": 35658,
            "position": 7
          },
          {
            "end_time": 104300,
            "temperature": null,
            "id": 35659,
            "position": 8,
            "display_text": "Transfer the chilled tart crust to a baking sheet. Pour the filling into the crust and smooth into an even layer with a spatula.",
            "start_time": 91333,
            "appliance": null
          },
          {
            "end_time": 109500,
            "temperature": null,
            "id": 35660,
            "position": 9,
            "display_text": "Arrange the peach slices over the filling in concentric circles.",
            "start_time": 104466,
            "appliance": null
          },
          {
            "id": 35661,
            "position": 10,
            "display_text": "Bake for 25-30 minutes, until the crust begins to darken and the peaches start to dry out.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null
          },
          {
            "display_text": "Let the tart cool for at least 1 hour before unmolding.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 35662,
            "position": 11
          },
          {
            "appliance": null,
            "end_time": 123966,
            "temperature": null,
            "id": 35663,
            "position": 12,
            "display_text": "Slice and serve with ice cream, if desired.",
            "start_time": 112666
          },
          {
            "start_time": 123633,
            "appliance": null,
            "end_time": 130600,
            "temperature": null,
            "id": 35664,
            "position": 13,
            "display_text": "Enjoy!"
          }
        ],
