        "instructions": [
          {
            "appliance": "stovetop",
            "end_time": 0,
            "temperature": 350,
            "id": 50741,
            "position": 1,
            "display_text": "Heat the canola oil in a large heavy-bottomed pot over medium heat until it reaches 350°F (180°C). Set a wire rack inside a rimmed baking sheet.",
            "start_time": 0
          },
          {
            "start_time": 5000,
            "appliance": null,
            "end_time": 20000,
            "temperature": null,
            "id": 50742,
            "position": 2,
            "display_text": "In a large bowl, whisk together the flour, brown sugar, ½ teaspoon cinnamon, the nutmeg, allspice, salt, and baking powder."
          },
          {
            "appliance": null,
            "end_time": 41000,
            "temperature": null,
            "id": 50743,
            "position": 3,
            "display_text": "In a separate large bowl, whisk together ⅔ cup (160 ml) almond milk, the vegetable oil, apple, melted margarine, and vanilla.",
            "start_time": 23000
          },
          {
            "end_time": 56983,
            "temperature": null,
            "id": 50744,
            "position": 4,
            "display_text": "Slowly add the dry ingredients to the wet ingredients and stir until smooth.",
            "start_time": 42500,
            "appliance": null
          },
          {
            "id": 50745,
            "position": 5,
            "display_text": "Working in batches, scoop the batter in ¼-cup (60 ml) increments into the hot oil and fry until golden brown and cooked through, 4–5 minutes. Transfer the fritters to the wire rack with a slotted spoon and let cool.",
            "start_time": 58000,
            "appliance": null,
            "end_time": 79666,
            "temperature": null
          },
          {
            "display_text": "Meanwhile, add the powdered sugar, remaining ½ teaspoon cinnamon, and remaining ¼ cup (60 ml) almond milk to a medium bowl and whisk until smooth.",
            "start_time": 81000,
            "appliance": null,
            "end_time": 94333,
            "temperature": null,
            "id": 50746,
            "position": 6
          },
          {
            "end_time": 104500,
            "temperature": null,
            "id": 50747,
            "position": 7,
            "display_text": "Drizzle the glaze over the fritters and let set for 5 minutes before serving.",
            "start_time": 95500,
            "appliance": null
          },
          {
            "temperature": null,
            "id": 50748,
            "position": 8,
            "display_text": "Enjoy!",
            "start_time": 106166,
            "appliance": null,
            "end_time": 110500
          }
        ],
