        "instructions": [
          {
            "display_text": "To make the crust, blend together the cookie sandwiches and the vegan butter in a food processor. Blend for 10 seconds at a time until the cookies have absorbed all the butter. The mix should stick when pressed together.",
            "start_time": 12666,
            "appliance": null,
            "end_time": 20500,
            "temperature": null,
            "id": 33216,
            "position": 1
          },
          {
            "appliance": null,
            "end_time": 33666,
            "temperature": null,
            "id": 33217,
            "position": 2,
            "display_text": "Transfer to a greased pie pan, press to form a crust.",
            "start_time": 22000
          },
          {
            "temperature": null,
            "id": 33218,
            "position": 3,
            "display_text": "Refrigerate for 30 minutes.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0
          },
          {
            "start_time": 5000,
            "appliance": null,
            "end_time": 9666,
            "temperature": null,
            "id": 33220,
            "position": 4,
            "display_text": "To make the filling, place your dates in a bowl and soak them in the boiling water for 10-15 minutes."
          },
          {
            "end_time": 46833,
            "temperature": null,
            "id": 33221,
            "position": 5,
            "display_text": "Transfer the dates and the water to a food processor and blend for 10 seconds at a time until a thick paste has formed. Transfer to a large mixing bowl.",
            "start_time": 36833,
            "appliance": null
          },
          {
            "appliance": null,
            "end_time": 60666,
            "temperature": null,
            "id": 33222,
            "position": 6,
            "display_text": "Add the rest of the ingredients for the filling into the mixing bowl and fold them into the paste. Mix thoroughly.",
            "start_time": 48000
          },
          {
            "end_time": 69416,
            "temperature": 350,
            "id": 33223,
            "position": 7,
            "display_text": "Pour the mix into the chilled pie crust. Bake in the oven at 350° F (180° C) for 40-45 minutes. The texture should be thick and fudgy.",
            "start_time": 61666,
            "appliance": "oven"
          },
          {
            "start_time": 77000,
            "appliance": null,
            "end_time": 86833,
            "temperature": null,
            "id": 33224,
            "position": 8,
            "display_text": "Enjoy!"
          }
        ],
