        "instructions": [
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 37732,
            "position": 1,
            "display_text": "Grease an 8-inch (20 cm) tart pan generously with coconut oil."
          },
          {
            "appliance": null,
            "end_time": 24333,
            "temperature": null,
            "id": 37733,
            "position": 2,
            "display_text": "Add the almonds, cashews, dates, coconut, coconut milk, vanilla, and salt to a food processor and pulse until the nuts are finely ground and the crust starts to clump together.",
            "start_time": 5000
          },
          {
            "start_time": 26000,
            "appliance": null,
            "end_time": 35849,
            "temperature": null,
            "id": 37734,
            "position": 3,
            "display_text": "Transfer the crust to the tart pan and use your hands to press it into an even layer. Chill in the refrigerator while making the filling."
          },
          {
            "temperature": null,
            "id": 37735,
            "position": 4,
            "display_text": "Add the avocados, coconut butter, cornstarch, key lime zest, key lime juice, maple syrup, coconut milk, vanilla, and salt to a food processor and blend until smooth and fully combined.",
            "start_time": 38683,
            "appliance": null,
            "end_time": 59033
          },
          {
            "end_time": 80883,
            "temperature": null,
            "id": 37736,
            "position": 5,
            "display_text": "Pour the filling into the crust and spread into an even layer. Garnish with shredded coconut, if desired.",
            "start_time": 61199,
            "appliance": null
          },
          {
            "id": 37737,
            "position": 6,
            "display_text": "Chill for at least 3 hours, or overnight, until the filling has fully set.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null
          },
          {
            "end_time": 97333,
            "temperature": null,
            "id": 37738,
            "position": 7,
            "display_text": "Enjoy!",
            "start_time": 94500,
            "appliance": null
          }
        ],
