        "original_video_url": "https://s3.amazonaws.com/video-api-prod/assets/d5cc21042a3a47319986ba9d9a6cf529/BFV23310_Dairy-FreeStrawberryCheesecake_FB.mp4",
        "instructions": [
          {
            "end_time": 3580,
            "temperature": null,
            "id": 19959,
            "position": 1,
            "display_text": "Place the cashews in a medium bowl and cover with cold water. Let the cashews soak for at least for 4 hours, or overnight, until soft.",
            "start_time": 0,
            "appliance": null
          },
          {
            "position": 2,
            "display_text": "Make the crust: Using a food processor, pulse together the pecans, almond flour, dates, cinnamon, coconut oil, and a pinch of salt. Pulse until the pecans have been broken down into crumbs and the crust begins to stick together.",
            "start_time": 4530,
            "appliance": null,
            "end_time": 19170,
            "temperature": null,
            "id": 19960
          },
          {
            "temperature": null,
            "id": 19961,
            "position": 3,
            "display_text": "Transfer the crust to a greased and parchment paper-lined 8-inch (20 cm) springform pan. Use your fingers to press the crust into the bottom of the pan in an even layer.",
            "start_time": 20020,
            "appliance": null,
            "end_time": 25000
          },
          {
            "id": 19962,
            "position": 4,
            "display_text": "Make the filling: Drain the soaked cashews and place them in the bowl of the food processor. Add the coconut milk, lemon juice, coconut oil, maple syrup, and vanilla. Blend until very smooth, 5-7 minutes.",
            "start_time": 25700,
            "appliance": null,
            "end_time": 40190,
            "temperature": null
          },
          {
            "position": 5,
            "display_text": "Pour roughly ⅔ of the cashew filling over the crust. Use a spatula to gently spread the mixture to the sides, then tap and shake the pan on the counter to achieve a smooth, even layer.",
            "start_time": 40730,
            "appliance": null,
            "end_time": 46809,
            "temperature": null,
            "id": 19963
          },
          {
            "display_text": "Freeze the pan while preparing the strawberry layer, about 10 minutes.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 19964,
            "position": 6
          },
          {
            "display_text": "Add the strawberries into the remaining cashew mixture in the food processor and puree until smooth, scraping down the sides of the bowl as needed, about 5 minutes.",
            "start_time": 48930,
            "appliance": null,
            "end_time": 54970,
            "temperature": null,
            "id": 19965,
            "position": 7
          },
          {
            "temperature": null,
            "id": 19966,
            "position": 8,
            "display_text": "Scrape the strawberry filling over the first layer. Use a spatula to gently push the layer out to the sides of the pan and tap and shake the pan on the counter to achieve a smooth, even layer.",
            "start_time": 55809,
            "appliance": null,
            "end_time": 61060
          },
          {
            "start_time": 61760,
            "appliance": null,
            "end_time": 64129,
            "temperature": null,
            "id": 19967,
            "position": 9,
            "display_text": "Top the cheesecake with sliced strawberries."
          },
          {
            "temperature": null,
            "id": 19968,
            "position": 10,
            "display_text": "Freeze the cheesecake until solid, at least 4 hours.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0
          },
          {
            "end_time": 76200,
            "temperature": null,
            "id": 19969,
            "position": 11,
            "display_text": "To serve, let the cheesecake thaw at room temperature for at least 10 minutes before slicing.",
            "start_time": 67200,
            "appliance": null
          },
          {
            "end_time": 80899,
            "temperature": null,
            "id": 19970,
            "position": 12,
            "display_text": "Enjoy!",
            "start_time": 77170,
            "appliance": null
          }
        ],
