        "instructions": [
          {
            "id": 6951,
            "position": 1,
            "display_text": "Add coconut butter and maple syrup to a saucepan over medium heat.",
            "start_time": 0,
            "appliance": null,
            "end_time": 4317,
            "temperature": null
          },
          {
            "display_text": "Cook for 2-3 minutes while stirring constantly. The mixture should start out smooth then thicken into a dense paste.",
            "start_time": 5317,
            "appliance": null,
            "end_time": 7650,
            "temperature": null,
            "id": 8835,
            "position": 2
          },
          {
            "id": 6952,
            "position": 3,
            "display_text": "Add peanut butter and vanilla extract to the saucepan and stir to incorporate. Continue to cook for an additional 2-4 minutes until the mixture achieves a smooth and pourable texture.",
            "start_time": 9000,
            "appliance": null,
            "end_time": 17000,
            "temperature": null
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 6953,
            "position": 4,
            "display_text": "Remove the peanut butter mixture from the heat and allow it to cool slightly."
          },
          {
            "id": 7317,
            "position": 5,
            "display_text": "While the mixture cools, break up the baking bar of chocolate into a microwave-safe bowl and microwave it for 1 minute (stirring every 15 seconds) or until it is completely melted and smooth.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null
          },
          {
            "display_text": "Prepare a 9x9-inch (23x23 cm) baking tray by spraying it with nonstick cooking spray and layering it with a piece of parchment paper.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 6954,
            "position": 6
          },
          {
            "display_text": "Pour half of the peanut butter mixture into the baking tray and spread it out evenly.",
            "start_time": 21000,
            "appliance": null,
            "end_time": 29000,
            "temperature": null,
            "id": 7318,
            "position": 7
          },
          {
            "appliance": null,
            "end_time": 36000,
            "temperature": null,
            "id": 7319,
            "position": 8,
            "display_text": "Add the melted chocolate to the remaining peanut butter mixture and mix thoroughly.",
            "start_time": 31000
          },
          {
            "temperature": null,
            "id": 8836,
            "position": 9,
            "display_text": "Once incorporated, layer the chocolate mixture into the baking tray, over top of the peanut butter layer, and spread it evenly.",
            "start_time": 37000,
            "appliance": null,
            "end_time": 43000
          },
          {
            "end_time": 0,
            "temperature": null,
            "id": 7320,
            "position": 10,
            "display_text": "Give the tray a few shakes and taps to remove any possible air bubbles and place the tray in the freezer for 1.5-2 hours to set.",
            "start_time": 0,
            "appliance": null
          },
          {
            "position": 11,
            "display_text": "Turnover the baking tray to remove the fudge. Cut into small rectangular pieces before serving. ",
            "start_time": 46000,
            "appliance": null,
            "end_time": 52317,
            "temperature": null,
            "id": 6955
          },
          {
            "temperature": null,
            "id": 10704,
            "position": 12,
            "display_text": "NOTE: Fudge should be stored in the refrigerator until ready to serve.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0
          },
          {
            "display_text": "Enjoy!",
            "start_time": 53317,
            "appliance": null,
            "end_time": 56367,
            "temperature": null,
            "id": 6956,
            "position": 13
          }
        ],
