            "description": "We're grateful for a lot of things: summery Sundays, lounging by the pool, the list goes on. But we're grapeful for the plentiful bounty of fruit that the sultry summer brings. The options are endless, from our <a href=\"https://tasty.co/recipe/fruit-mille-crepe\">fruit mille crepe</a> that's as fancy as they come to a dinner party favorite: our <a href=\"https://tasty.co/recipe/rice-cooker-upside-down-pineapple-cake\">slow-cooker pineapple upside down cake</a>. Can't choose just one fruit? No problem - make a delicious <a href=\"https://tasty.co/recipe/rainbow-fruit-salad-with-honey-lime-dressing\">rainbow fruit salad with honey lime dressing</a>. The fruit fiesta never ends, especially not with these recipes!",
