        "name": "Vegan Snowflake Sugar Cookies",
        "_index": "recipes-20211108215649",
        "instructions": [
          {
            "appliance": "oven",
            "end_time": 0,
            "temperature": 350,
            "id": 42991,
            "position": 1,
            "display_text": "Preheat the oven to 350°F (180°C). Line 2 baking sheets with parchment paper.",
            "start_time": 0
          },
          {
            "start_time": 12000,
            "appliance": null,
            "end_time": 18166,
            "temperature": null,
            "id": 42992,
            "position": 2,
            "display_text": "In a large bowl, cream together the sugar and coconut oil with an electric hand mixer until fluffy."
          },
          {
            "start_time": 19000,
            "appliance": null,
            "end_time": 23833,
            "temperature": null,
            "id": 42993,
            "position": 3,
            "display_text": "Add the vanilla and salt, and stir with a rubber spatula to combine. Set aside."
          },
          {
            "start_time": 25000,
            "appliance": null,
            "end_time": 31333,
            "temperature": null,
            "id": 42994,
            "position": 4,
            "display_text": "Sift the flour and baking powder into a medium bowl."
          },
          {
            "display_text": "Gradually add the flour mixture to the coconut oil mixture and stir to combine.",
            "start_time": 32000,
            "appliance": null,
            "end_time": 40833,
            "temperature": null,
            "id": 42995,
            "position": 5
          },
          {
            "temperature": null,
            "id": 42996,
            "position": 6,
            "display_text": "Gradually add the non-dairy milk and stir until a crumbly dough forms. Using your hands, knead the dough into a ball.",
            "start_time": 40834,
            "appliance": null,
            "end_time": 53000
          },
          {
            "temperature": null,
            "id": 42997,
            "position": 7,
            "display_text": "On a lightly floured surface, roll out the dough to about ¼-inch (½ cm) thick.",
            "start_time": 53000,
            "appliance": null,
            "end_time": 58833
          },
          {
            "appliance": null,
            "end_time": 68666,
            "temperature": null,
            "id": 42998,
            "position": 8,
            "display_text": "Use snowflake cookie cutters to cut out shapes and transfer to the prepared baking sheets about 2 inches (5 cm) apart. Re-roll excess dough to cut out more shapes.",
            "start_time": 59000
          },
          {
            "end_time": 0,
            "temperature": null,
            "id": 42999,
            "position": 9,
            "display_text": "Bake for 10-12 minutes, until slightly golden around the edges .",
            "start_time": 0,
            "appliance": null
          },
          {
            "display_text": "Make the royal icing: Sift the powdered sugar into a large bowl. Add the vanilla and some of the water. Whisk until smooth, adding more water as needed to reach your desired consistency.",
            "start_time": 72000,
            "appliance": null,
            "end_time": 81833,
            "temperature": null,
            "id": 43000,
            "position": 10
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 43001,
            "position": 11,
            "display_text": "Transfer half of the icing to another bowl and add blue gel food coloring to one. Immediately transfer the icing to piping bags, or cover with plastic wrap. Do not leave the icing uncovered, as it will develop a film. If this happens, add a small amount of water and whisk to incorporate until the icing returns to your desired consistency."
          },
          {
            "id": 43002,
            "position": 12,
            "display_text": "Decorate the cookies with the royal icing and sprinkles. Let dry completely, at least 3-4 hours or overnight.",
            "start_time": 84000,
            "appliance": null,
            "end_time": 118333,
            "temperature": null
          },
          {
            "start_time": 120000,
            "appliance": null,
            "end_time": 128000,
            "temperature": null,
            "id": 43003,
            "position": 13,
            "display_text": "Enjoy!"
          }
        ],
