        "instructions": [
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 5666,
            "temperature": null,
            "id": 39081,
            "position": 1,
            "display_text": "Make the crust: In a large bowl, combine the flour, sugar, and salt."
          },
          {
            "start_time": 6000,
            "appliance": null,
            "end_time": 19333,
            "temperature": null,
            "id": 39082,
            "position": 2,
            "display_text": "Add the cubed butter, a bit at a time, and use a fork to work it into the flour with a fork until it breaks down to dime-sized pieces."
          },
          {
            "id": 39083,
            "position": 3,
            "display_text": "Gradually add the ice water and mix just until the dough can be pressed together.",
            "start_time": 21166,
            "appliance": null,
            "end_time": 33966,
            "temperature": null
          },
          {
            "id": 39084,
            "position": 4,
            "display_text": "Divide the dough in half and shape into discs. Wrap in plastic wrap and chill in the fridge for 1 hour.",
            "start_time": 34333,
            "appliance": null,
            "end_time": 43833,
            "temperature": null
          },
          {
            "appliance": "oven",
            "end_time": 0,
            "temperature": 350,
            "id": 39085,
            "position": 5,
            "display_text": "Preheat the oven to 350˚F (180˚C).",
            "start_time": 0
          },
          {
            "start_time": 49500,
            "appliance": null,
            "end_time": 88166,
            "temperature": null,
            "id": 39086,
            "position": 6,
            "display_text": "Make the filling: Peel and core apples, then thinly slice. Transfer to a large bowl and add 2 cups (200 G) of sugar, the lemon zest, cornstarch, lemon juice, 1 teaspoon melted coconut oil, salt, and 3 teaspoons cinnamon. Toss until the apples are well-coated. Set aside."
          },
          {
            "temperature": null,
            "id": 39087,
            "position": 7,
            "display_text": "On a lightly floured surface, roll out both of the discs of dough to about 1 inch (2 cm) thick. Transfer one round to a greased 8-inch (20-cm) pie dish and gently press against the bottom and sides. Trim the excess dough around the edges, then prick the bottom of the pie crust all over with a fork",
            "start_time": 91333,
            "appliance": null,
            "end_time": 114166
          },
          {
            "appliance": null,
            "end_time": 138500,
            "temperature": null,
            "id": 39088,
            "position": 8,
            "display_text": "Pour the apples into the bottom crust and cover with the top crust. Trim the excess dough around the edges, then crimp the top and bottom crusts together with a fork. Brush the top of the crust with the remaining tablespoon of melted coconut oil and sprinkle with the remaining teaspoon of sugar and cinnamon. Cut 4 vents in the top crust",
            "start_time": 115000
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 39089,
            "position": 9,
            "display_text": "Bake for 1 hour, until crust is starting to turn golden brown."
          },
          {
            "appliance": null,
            "end_time": 156966,
            "temperature": null,
            "id": 39090,
            "position": 10,
            "display_text": "Let cool for 10 minutes, then slice and serve.",
            "start_time": 142333
          },
          {
            "display_text": "Enjoy!",
            "start_time": 157000,
            "appliance": null,
            "end_time": 161833,
            "temperature": null,
            "id": 39091,
            "position": 11
          }
        ],
