        "instructions": [
          {
            "end_time": 0,
            "temperature": null,
            "id": 30248,
            "position": 1,
            "display_text": "In a microwave-safe measuring cup, or in a small pot on the stove, heat the coconut milk until hot, but not boiling (about 2 minutes in the microwave).",
            "start_time": 0,
            "appliance": null
          },
          {
            "position": 2,
            "display_text": "Place the dairy-free chocolate in a large bowl and pour the hot coconut milk over it, allowing the milk to melt the chocolate. Mix well to combine.",
            "start_time": 14500,
            "appliance": null,
            "end_time": 24666,
            "temperature": null,
            "id": 30249
          },
          {
            "display_text": "Once the chocolate is melted, add the coconut oil and powdered sugar. Beat with a hand mixer or whisk until smooth.",
            "start_time": 24667,
            "appliance": null,
            "end_time": 34950,
            "temperature": null,
            "id": 30250,
            "position": 3
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 30251,
            "position": 4,
            "display_text": "Cover and refrigerate overnight."
          },
          {
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0,
            "temperature": 350,
            "id": 30252,
            "position": 5,
            "display_text": "Preheat the oven to 350°F (180°C). Grease 3 separate 8-inch (20-cm) round cake pans and set aside."
          },
          {
            "start_time": 39000,
            "appliance": null,
            "end_time": 51166,
            "temperature": null,
            "id": 30253,
            "position": 6,
            "display_text": "In a large bowl, add the whole wheat flour, dark cocoa powder, sugar, baking soda, baking powder, and salt. Whisk to combine and set aside."
          },
          {
            "position": 7,
            "display_text": "In a separate large bowl, add the almond milk, coconut oil, applesauce, maple syrup, apple cider vinegar, and vanilla extract. Whisk to combine.",
            "start_time": 52500,
            "appliance": null,
            "end_time": 66616,
            "temperature": null,
            "id": 30254
          },
          {
            "temperature": null,
            "id": 30255,
            "position": 8,
            "display_text": "In two batches, add the dry mixture to the wet mixture, folding with a spatula until combined. Some clumps are okay.",
            "start_time": 66617,
            "appliance": null,
            "end_time": 78566
          },
          {
            "start_time": 79566,
            "appliance": null,
            "end_time": 83016,
            "temperature": null,
            "id": 30256,
            "position": 9,
            "display_text": "Divide the batter evenly between the 3 pre-greased cake pans and bake for 35–45 minutes, or until a toothpick comes out almost entirely clean. Cool completely."
          },
          {
            "id": 30257,
            "position": 10,
            "display_text": "Remove the frosting from the fridge and mix it up well.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null
          },
          {
            "start_time": 102000,
            "appliance": null,
            "end_time": 150666,
            "temperature": null,
            "id": 30258,
            "position": 11,
            "display_text": "Choose which cake will be your bottom layer and cover evenly with about 1 cup (115 G) of frosting. Top with the second layer, frosting evenly again. Add the final layer and frost the top and the sides of the cake generously, topping with berries of choice for garnish."
          },
          {
            "display_text": "Enjoy!",
            "start_time": 151000,
            "appliance": null,
            "end_time": 167666,
            "temperature": null,
            "id": 30259,
            "position": 12
          }
        ],
