        "instructions": [
          {
            "display_text": "Gently melt the butter over a low-medium heat. Add milk and 2 tablespoons of sunflower oil and mix together. Once combined, take off the heat and set aside.",
            "start_time": 63850,
            "appliance": null,
            "end_time": 71970,
            "temperature": null,
            "id": 24001,
            "position": 1
          },
          {
            "end_time": 78730,
            "temperature": null,
            "id": 24002,
            "position": 2,
            "display_text": "In a separate bowl, combine the flour, half of the sugar, baking powder and salt with a fork. Make a well in the centre.",
            "start_time": 72420,
            "appliance": null
          },
          {
            "start_time": 79000,
            "appliance": null,
            "end_time": 83150,
            "temperature": null,
            "id": 24222,
            "position": 3,
            "display_text": "Pour the butter mixture into the well. Combine gradually until a thick dough forms."
          },
          {
            "temperature": null,
            "id": 24003,
            "position": 4,
            "display_text": "Using your hands, roll dough into little flat balls and with your thumb, press a hole in the centre of each doughnut. (You may need to flour your hands for this part to avoid getting sticky!)",
            "start_time": 83280,
            "appliance": null,
            "end_time": 88280
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 24004,
            "position": 5,
            "display_text": "Heat up the litre of oil in a pan. To know when it's hot enough, fry a little bit of bread in the oil. If it goes brown and floats to the top, in 45-50 seconds the oil will be ready!"
          },
          {
            "start_time": 88420,
            "appliance": null,
            "end_time": 92789,
            "temperature": null,
            "id": 24221,
            "position": 6,
            "display_text": "Gently lay the doughnuts into the oil using a spatula. Fry for about 3-5 minutes on each side, until golden brown."
          },
          {
            "appliance": null,
            "end_time": 101890,
            "temperature": null,
            "id": 24005,
            "position": 7,
            "display_text": "Transfer the doughnuts onto some tissue paper to soak up any excess oil. Then roll into a bowl of the remaining sugar.",
            "start_time": 93540
          },
          {
            "temperature": null,
            "id": 24006,
            "position": 8,
            "display_text": "Enjoy!",
            "start_time": 102930,
            "appliance": null,
            "end_time": 105820
          }
        ],
