        "instructions": [
          {
            "id": 36270,
            "position": 1,
            "display_text": "Preheat the oven to 350°F (180°C). Line an 8-inch (20 cm) square baking dish with parchment paper.",
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0,
            "temperature": 350
          },
          {
            "end_time": 10333,
            "temperature": null,
            "id": 36271,
            "position": 2,
            "display_text": "Chop the chocolate into ½-inch (1 ¼ cm) pieces. Set aside half and melt the other half in a microwave-safe bowl for 45 seconds.",
            "start_time": 5000,
            "appliance": null
          },
          {
            "start_time": 11000,
            "appliance": null,
            "end_time": 16500,
            "temperature": null,
            "id": 36272,
            "position": 3,
            "display_text": "Make the flax egg: combine the ground flaxseeds with the water in a small bowl and mix with a fork. Set aside for at least 10 minutes to gel."
          },
          {
            "temperature": null,
            "id": 36273,
            "position": 4,
            "display_text": "In a medium bowl, add the sugar and vegan butter and whisk until smooth. Then add the vanilla, flax eggs, and melted chocolate and whisk until well-combined.",
            "start_time": 17333,
            "appliance": null,
            "end_time": 32000
          },
          {
            "appliance": null,
            "end_time": 52449,
            "temperature": null,
            "id": 36274,
            "position": 5,
            "display_text": "Sift in the flour, cocoa powder, baking powder, and salt and fold with a spatula until all ingredients are combined. Be careful not to overmix. Then, stir in the reserved chocolate pieces.",
            "start_time": 33666
          },
          {
            "position": 6,
            "display_text": "Pour the batter into the baking dish and smooth the top with a spatula.",
            "start_time": 53000,
            "appliance": null,
            "end_time": 58333,
            "temperature": null,
            "id": 36275
          },
          {
            "start_time": 60000,
            "appliance": null,
            "end_time": 62500,
            "temperature": null,
            "id": 36276,
            "position": 7,
            "display_text": "Bake for 30-35 minutes, until a fork inserted in the center comes out clean. Let cool for at least 20 minutes."
          },
          {
            "appliance": null,
            "end_time": 73000,
            "temperature": null,
            "id": 36277,
            "position": 8,
            "display_text": "Slice into 9 equal-sized pieces and serve.",
            "start_time": 64333
          },
          {
            "id": 36278,
            "position": 9,
            "display_text": "Enjoy!",
            "start_time": 77000,
            "appliance": null,
            "end_time": 78333,
            "temperature": null
          }
        ],
