        "keywords": "tasty, tasty_vegetarian",
        "slug": "the-best-ever-vegan-cinnamon-rolls",
        "instructions": [
          {
            "display_text": "Generously rub two disposable foil pie pans with vegan butter.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 28785,
            "position": 1
          },
          {
            "end_time": 12383,
            "temperature": null,
            "id": 28786,
            "position": 2,
            "display_text": "In a large bowl, whisk together the almond milk, melted butter, and sugar. The mixture should be just warm, registering between 100-110˚F (37-43˚C). If it is hotter, allow to cool slightly.",
            "start_time": 3666,
            "appliance": null
          },
          {
            "start_time": 12384,
            "appliance": null,
            "end_time": 15433,
            "temperature": null,
            "id": 28787,
            "position": 3,
            "display_text": "Sprinkle the yeast evenly over the warm mixture and let set for 1 minute."
          },
          {
            "appliance": null,
            "end_time": 24333,
            "temperature": null,
            "id": 28788,
            "position": 4,
            "display_text": "Add 5 cups flour and 1 teaspoon of salt to the milk mixture and mix with a wooden spoon until just combined.",
            "start_time": 16000
          },
          {
            "position": 5,
            "display_text": "Cover the bowl with a towel or plastic wrap and set in a warm place to rise for 1 hour.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 28789
          },
          {
            "temperature": 350,
            "id": 28790,
            "position": 6,
            "display_text": "Preheat oven to 350˚F (180˚C).",
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0
          },
          {
            "id": 28791,
            "position": 7,
            "display_text": "After 1 hour, the dough should have nearly doubled in size.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null
          },
          {
            "start_time": 28333,
            "appliance": null,
            "end_time": 42166,
            "temperature": null,
            "id": 28792,
            "position": 8,
            "display_text": "Remove the towel and add an additional ½ cup (95g) of flour and salt. Stir well, then turn out onto a well-floured surface."
          },
          {
            "position": 9,
            "display_text": "Knead the dough lightly, adding additional flour as necessary, until the dough just loses its stickiness and does not stick to the surface.",
            "start_time": 42167,
            "appliance": null,
            "end_time": 50550,
            "temperature": null,
            "id": 28793
          },
          {
            "start_time": 52000,
            "appliance": null,
            "end_time": 57166,
            "temperature": null,
            "id": 28794,
            "position": 10,
            "display_text": "Roll the dough out into a large rectangle, about ½-inch (1 cm) thick. Fix corners to make sure they are sharp and even."
          },
          {
            "position": 11,
            "display_text": "Spread the softened vegan butter evenly over the dough.",
            "start_time": 57000,
            "appliance": null,
            "end_time": 60166,
            "temperature": null,
            "id": 28795
          },
          {
            "position": 12,
            "display_text": "Sprinkle evenly with brown sugar and cinnamon.",
            "start_time": 62000,
            "appliance": null,
            "end_time": 67383,
            "temperature": null,
            "id": 28796
          },
          {
            "appliance": null,
            "end_time": 74266,
            "temperature": null,
            "id": 28797,
            "position": 13,
            "display_text": "Roll up the dough, forming a log, and pinch the seam closed. Place seam-side down. Trim off any unevenness on either end.",
            "start_time": 68216
          },
          {
            "display_text": "Cut the log in half, then divide each half into 7 evenly sized pieces. About 1½ inches (8 cm) thick each.",
            "start_time": 74933,
            "appliance": null,
            "end_time": 81816,
            "temperature": null,
            "id": 28798,
            "position": 14
          },
          {
            "end_time": 86533,
            "temperature": null,
            "id": 28799,
            "position": 15,
            "display_text": "Place 7 cinnamon rolls in each cake pan, one in the center, six around the sides. Cover with plastic wrap and place in a warm place to rise for 30 minutes.",
            "start_time": 82483,
            "appliance": null
          },
          {
            "start_time": 90700,
            "appliance": null,
            "end_time": 100250,
            "temperature": null,
            "id": 28800,
            "position": 16,
            "display_text": "To prepare the frosting. In a medium-size mixing bowl, whisk together powdered sugar, almond milk, and vanilla until smooth."
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 28801,
            "position": 17,
            "display_text": "Remove plastic wrap. Bake the cinnamon rolls in a preheated oven at 350˚F (180˚C) for 25-30 minutes, until golden brown."
          },
          {
            "display_text": "While still warm, drizzle evenly with frosting.",
            "start_time": 105000,
            "appliance": null,
            "end_time": 114166,
            "temperature": null,
            "id": 28802,
            "position": 18
          },
          {
            "appliance": null,
            "end_time": 121716,
            "temperature": null,
            "id": 28803,
            "position": 19,
            "display_text": "Enjoy!",
            "start_time": 116333
          }
        ],
