    "instructions": [
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 68797,
        "position": 1,
        "display_text": "Prep the squash: Cut the kabocha squash in half through the stem and scoop out the seeds. Cut each half in half, then cut into ½-inch-thick slices. Transfer to a large bowl.",
        "start_time": 0
      },
      {
        "end_time": 0,
        "temperature": null,
        "id": 68798,
        "position": 2,
        "display_text": "Cut the ends off the delicata squash, then slice in half lengthwise. Scoop out the seeds, then cut into ½-inch-thick slices. Add to the bowl with the kabocha squash. Season with the salt, white pepper, sesame oil, and ginger and toss to coat.",
        "start_time": 0,
        "appliance": null
      },
      {
        "temperature": null,
        "id": 68799,
        "position": 3,
        "display_text": "Make the sauce: Melt the butter in a small pot over medium heat. Add the garlic and let sizzle for a minute, until fragrant. Add the gochujang, ketchup, honey, brown sugar, rice vinegar, soy sauce, and sesame oil and whisk to combine. Bring to a simmer and cook for 2–3 minutes, then remove the pot from the heat.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 68800,
        "position": 4,
        "display_text": "In a medium bowl, stir together the potato starch and the panko. Sprinkle over the squash and toss to coat evenly (if the squash pieces do not have an even light white coating, add more potato starch and toss again). Press the panko onto the squash to adhere."
      },
      {
        "appliance": "oven",
        "end_time": 0,
        "temperature": 350,
        "id": 68801,
        "position": 5,
        "display_text": "Heat a few inches of canola oil in a wok over medium-high heat until the temperature reaches 350°F (180°C). Place a wire rack over a sheet tray.",
        "start_time": 0
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 68802,
        "position": 6,
        "display_text": "Working in batches to avoid overcrowding the pan, use tongs to carefully lower the squash pieces into the hot oil. Fry for 4–6 minutes, until dark golden brown. Transfer to the wire rack."
      },
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 68803,
        "position": 7,
        "display_text": "While the squash is still hot, toss in a large bowl with the sauce until well coated.",
        "start_time": 0
      },
      {
        "position": 8,
        "display_text": "Garnished with sliced scallions and sesame seeds, then serve.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 68804
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 68805,
        "position": 9,
        "display_text": "Enjoy!"
      }
    ],
