    "instructions": [
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67988,
        "position": 1,
        "display_text": "First, soak shiitake mushrooms in boiling water for 15 minutes and slice.",
        "start_time": 0
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67989,
        "position": 2,
        "display_text": "Cook udon noodles in the pot with boiling water for 1-2 minutes until the noodles are loose. Drain them, then set them aside."
      },
      {
        "position": 3,
        "display_text": "In a frying pan on medium-heat, saute brown onion, shiitake mushrooms, carrot, and garlic until soft. Then, add cabbage and mushroom-soaking liquid and cook until cabbage is softened. Then, add light and dark soy sauce, oyster sauce, and ground white pepper and cook for 1-2 minutes.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67990
      },
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67991,
        "position": 4,
        "display_text": "Return udon noodles back to the pan, stir and mix with the sauces until noodles are well-coated.",
        "start_time": 0
      },
      {
        "temperature": null,
        "id": 67992,
        "position": 5,
        "display_text": "Add black vinegar in, stir, and cook for a few minutes. Add salt to taste.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "id": 67993,
        "position": 6,
        "display_text": "Finish with sesame oil, then garnish with black and white sesame seeds, shredded Nori, and spring onion.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null
      },
      {
        "display_text": "Serve warm.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67994,
        "position": 7
      }
    ],
