        "instructions": [
          {
            "end_time": 36833,
            "temperature": null,
            "id": 53437,
            "position": 1,
            "display_text": "Marinate the beer-battered sweet potatoes: In a wide, shallow dish, whisk together the oil, soy sauce, lemongrass, garlic, lime juice, and rice wine vinegar. Add the sweet potatoes to the marinade and toss to coat. Cover the dish with plastic wrap and marinate the sweet potatoes in the refrigerator for 1–2 hours.",
            "start_time": 7000,
            "appliance": null
          },
          {
            "end_time": 50166,
            "temperature": null,
            "id": 53438,
            "position": 2,
            "display_text": "Make the quick pickled vegetables: In a small pan, combine the rice wine vinegar, water, sugar, and salt. Bring to a low simmer over medium-high heat, stirring until the sugar is dissolved.",
            "start_time": 42000,
            "appliance": null
          },
          {
            "position": 3,
            "display_text": "Add the carrots and onion to 2 separate medium bowls. Pour half of the pickle brine into each bowl. Cover each bowl with plastic wrap and transfer to the refrigerator for at least 30 minutes, or overnight. The longer the vegetables pickle, the deeper the color of the red onions and the stronger the flavor of both will be.",
            "start_time": 52000,
            "appliance": null,
            "end_time": 64000,
            "temperature": null,
            "id": 53439
          },
          {
            "start_time": 66000,
            "appliance": null,
            "end_time": 74000,
            "temperature": null,
            "id": 53440,
            "position": 4,
            "display_text": "Make the mushroom pâté: Add the mushrooms to a food processor and pulse until finely chopped."
          },
          {
            "end_time": 102166,
            "temperature": null,
            "id": 53441,
            "position": 5,
            "display_text": "In a medium skillet, heat the olive oil over medium heat. When the oil is shimmering, add the red onion and garlic and sauté for 2–3 minutes, until fragrant. Add the mushrooms and cook for 5–8 minutes, until most of the moisture has been released and they begin to brown. Add the ginger, vegan Worcestershire sauce, and soy sauce. Cook for 1–2 minutes, until the liquid is fully absorbed and beginning to caramelize. Remove the pan from the heat and let cool for 5–10 minutes.",
            "start_time": 76000,
            "appliance": null
          },
          {
            "id": 53442,
            "position": 6,
            "display_text": "Return the mushroom mixture to the food processor and process until nearly smooth, 20–30 seconds. Set aside until ready to assemble the sandwiches.",
            "start_time": 106000,
            "appliance": null,
            "end_time": 115166,
            "temperature": null
          },
          {
            "position": 7,
            "display_text": "Finish the beer-battered sweet potato: In a large, high-walled skillet, heat the canola oil over medium-high heat until it reaches 375°F (190°C).",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 53443
          },
          {
            "display_text": "While the oil is heating, prepare the beer batter: In a shallow dish with a lip, whisk together the 1 cup (125 G) flour, the salt, and beer until smooth. Add the remaining ½ cup (60 G) flour to a separate shallow dish.",
            "start_time": 117000,
            "appliance": null,
            "end_time": 132833,
            "temperature": null,
            "id": 53444,
            "position": 8
          },
          {
            "appliance": null,
            "end_time": 150166,
            "temperature": null,
            "id": 53445,
            "position": 9,
            "display_text": "When the oil is hot, begin dredging the sweet potatoes. Working one plank at a time, remove the sweet potato from the marinade, letting any excess drip off. Lightly dredge in the flour, then coat in the beer batter.",
            "start_time": 134000
          },
          {
            "display_text": "Immediately drop the sweet potato plank into the hot oil. Fry in batches of 2 or 3 planks for 2–3 minutes,  flipping halfway through, until golden brown. Drain on a wire rack or paper towel-lined baking sheet. Let cool slightly.",
            "start_time": 153000,
            "appliance": null,
            "end_time": 165333,
            "temperature": null,
            "id": 53446,
            "position": 10
          },
          {
            "display_text": "Make the vegan chipotle mayonnaise: In a small bowl, mix together the mayonnaise and chipotle powder.",
            "start_time": 167000,
            "appliance": null,
            "end_time": 177833,
            "temperature": null,
            "id": 53447,
            "position": 11
          },
          {
            "start_time": 179000,
            "appliance": null,
            "end_time": 192000,
            "temperature": null,
            "id": 53448,
            "position": 12,
            "display_text": "Make the slaw: In a medium bowl, toss the cabbage with the salt and lime juice."
          },
          {
            "id": 53449,
            "position": 13,
            "display_text": "Assemble the sandwiches: Spread 2 tablespoons of the mushroom pâté onto the bottom of a toasted French roll. Top with cucumber ribbons and 3–4 slices of avocado. Add 1–2 sweet potato planks, then top with jalapeño, pickled carrots and onions, cabbage slaw, and cilantro. Spread chipotle mayonnaise on the top half of the roll, then close the sandwich.",
            "start_time": 194333,
            "appliance": null,
            "end_time": 228283,
            "temperature": null
          },
          {
            "end_time": 240333,
            "temperature": null,
            "id": 53450,
            "position": 14,
            "display_text": "Enjoy!",
            "start_time": 236000,
            "appliance": null
          }
        ],
