            "description": "Craving Asian food — but want to keep it vegan? Test out some of our most-popular vegan creations, from the <a href=\"https://tasty.co/recipe/veggie-sushi-4-ways\">shiitake veggie rolls</a> to a nutrient-dense tofu and quinoa-loaded <a href=\"https://tasty.co/recipe/protein-packed-buddha-bowl\">vegan buddha bowl</a>. We've even got a <a href=\"https://tasty.co/recipe/vegan-ramen\">vegan ramen</a>, and an authentic <a href=\"https://tasty.co/recipe/easy-peasy-potato-curry\">vegan curry dish</a> to impress your dinner guests, vegan or not. Let's get cooking!",
            "thumbnail_url": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/320203.jpg",
            "video_id": 130535,
