            "description": " Indian weddings are grand festivals. More importantly, they're an excuse: a glorious excuse to feast away, and well, we'd hate to have to deprive you and force you to gate crash. So instead, we're bringing you an Indian feast – it's just for you, believe us. We've got it all: the fried, the savory, the indulgent, and the oh-so-sweet. Amp up your favorite Bollywood playlist, gather a crowd, it's feasting time!",
