            "temperature": null,
            "id": 33640,
            "position": 7,
            "display_text": "Increase the heat to high and bring the mixture to a simmer. Once bubbling, reduce the heat to medium and cook for 15-20 minutes, until the potatoes are tender and easily pierced with a fork.",
