        "original_video_url": "https://s3.amazonaws.com/video-api-prod/assets/04d71f0dffca4c5a8a5bbd2722aa4db4/CauliflowerGnocchiFBFINAL.mp4",
        "instructions": [
          {
            "start_time": 5833,
            "appliance": null,
            "end_time": 12583,
            "temperature": null,
            "id": 39668,
            "position": 1,
            "display_text": "Add the cauliflower to a steamer basket set over a medium pot of boiling water. Cover and steam for 10 minutes, or until fork-tender."
          },
          {
            "appliance": null,
            "end_time": 20500,
            "temperature": null,
            "id": 39669,
            "position": 2,
            "display_text": "Transfer the cauliflower to a clean dish towel and squeeze the excess water into a bowl.",
            "start_time": 13416
          },
          {
            "end_time": 32750,
            "temperature": null,
            "id": 39670,
            "position": 3,
            "display_text": "Transfer the squeezed cauliflower to a food processor. Add the flour, salt, and olive oil and pulse until the dough forms a ball.",
            "start_time": 21000,
            "appliance": null
          },
          {
            "appliance": null,
            "end_time": 45000,
            "temperature": null,
            "id": 39671,
            "position": 4,
            "display_text": "Transfer the dough to a lightly floured surface and knead for 3-4 minutes, or until the dough bounces back when poked.",
            "start_time": 34583
          },
          {
            "id": 39672,
            "position": 5,
            "display_text": "Shape the dough into a ball, then cut into 4 equal pieces. ",
            "start_time": 45000,
            "appliance": null,
            "end_time": 50250,
            "temperature": null
          },
          {
            "temperature": null,
            "id": 39730,
            "position": 6,
            "display_text": "Working 1 piece at a time, cut in half again, then roll out a rope about 6 inches (3-cm) long and 1 inch (2-cm) wide. Slice each rope into ½-inch (1-cm) pieces.",
            "start_time": 50416,
            "appliance": null,
            "end_time": 67333
          },
          {
            "start_time": 67500,
            "appliance": null,
            "end_time": 75250,
            "temperature": null,
            "id": 39673,
            "position": 7,
            "display_text": "Roll each piece along the back of a fork to create a line pattern."
          },
          {
            "appliance": null,
            "end_time": 86666,
            "temperature": null,
            "id": 39674,
            "position": 8,
            "display_text": "Transfer the gnocchi to a large pot of salted boiling water. Boil until the gnocchi float to the surface, 3-5 minutes, then remove with a slotted spoon.",
            "start_time": 75583
          },
          {
            "end_time": 99916,
            "temperature": null,
            "id": 39675,
            "position": 9,
            "display_text": "Toss the gnocchi with pesto sauce and serve immediately.",
            "start_time": 87166,
            "appliance": null
          },
          {
            "start_time": 100583,
            "appliance": null,
            "end_time": 104000,
            "temperature": null,
            "id": 39676,
            "position": 10,
            "display_text": "Enjoy!"
          }
        ],
