        "instructions": [
          {
            "id": 51210,
            "position": 1,
            "display_text": "Preheat the oven to 375°F (190°C).",
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0,
            "temperature": 375
          },
          {
            "start_time": 5000,
            "appliance": null,
            "end_time": 24833,
            "temperature": null,
            "id": 51211,
            "position": 2,
            "display_text": "Make the purée: In a medium pot, heat the olive oil over medium heat until it begins to shimmer. Add the onion, sweet potato, potato, apple, thyme, and salt. Sauté for 8–10 minutes, until the vegetables begin to release their juices and soften."
          },
          {
            "start_time": 28000,
            "appliance": null,
            "end_time": 35666,
            "temperature": null,
            "id": 51212,
            "position": 3,
            "display_text": "Add ½ cup (120 ml) of vegetable stock and cover the pan. Reduce the heat to medium-low and cook for 20–25 minutes, until the vegetables are completely softened. Remove the pot from the heat."
          },
          {
            "start_time": 37000,
            "appliance": null,
            "end_time": 49166,
            "temperature": null,
            "id": 51213,
            "position": 4,
            "display_text": "Remove the thyme stems and discard. Add the remaining ¼ cup (60 ml) of vegetable stock and, using an immersion blender, blend until completely smooth. Season with more salt to taste."
          },
          {
            "start_time": 51000,
            "appliance": null,
            "end_time": 90333,
            "temperature": null,
            "id": 51214,
            "position": 5,
            "display_text": "Spread the purée over the bottom of an 10-inch (25 cm) cast iron skillet. Arrange the orange sweet potatoes, yellow potatoes, purple sweet potatoes, delicata squash, and apple slices in an alternating pattern on top, working from the outside in. Drizzle the olive oil over the top and season with the salt, pepper, and thyme."
          },
          {
            "display_text": "Cover the pan with foil and bake the ratatouille for 30 minutes, then uncover and bake for another 20–25 minutes, until the vegetables are softened and starting to brown.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 51215,
            "position": 6
          },
          {
            "position": 7,
            "display_text": "Drizzle the ratatouille with more olive oil to taste. Serve warm.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 51216
          },
          {
            "appliance": null,
            "end_time": 118500,
            "temperature": null,
            "id": 51217,
            "position": 8,
            "display_text": "Enjoy!",
            "start_time": 110000
          }
        ],
