    "name": "Low-Calorie Vegetarian Kimchi Jiggae",
    "tips_and_ratings_enabled": true,
    "video_ad_content": null,
    "original_video_url": null,
    "instructions": [
      {
        "display_text": "Lightly char the garlic in a hot pot (no oil needed). When it starts sizzling, add kimchi and stir-fry until aromatic. Then, incorporate the gochujang until well-combined.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67879,
        "position": 1
      },
      {
        "temperature": null,
        "id": 67880,
        "position": 2,
        "display_text": "Slowly add the dashi stock and bring to a boil.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "position": 3,
        "display_text": "Add enoki mushrooms, shirataki noodles, and potato starch or mung bean noodles and continue to boil. Then, lower heat and cover. Let cook for 10 minutes.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67881
      },
      {
        "temperature": null,
        "id": 67882,
        "position": 4,
        "display_text": "Season to taste with salt and pepper. Then, add bok choy. Cover and let cook.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "temperature": null,
        "id": 67883,
        "position": 5,
        "display_text": "Crack the egg into a separate small bowl and beat it. Add some liquid from the stew to make it more light.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67884,
        "position": 6,
        "display_text": "Once vegetables are 75% cooked in the stew, pour the egg into it in a circular motion and let simmer for 5 minutes while occasionally stirring."
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67885,
        "position": 7,
        "display_text": "Serve hot."
      }
    ],
