            "description": "We're all trying to do something for the environment (and for our health), and eating meatless is a double win. If you're just starting to embrace a plant-based lifestyle, these recipes will make your transition much easier and equally delicious. From \"meaty\" <a href=\"https://tasty.co/recipe/meatless-sloppy-joes\">sloppy joes</a> to <a href=\"https://tasty.co/recipe/vegan-crab-cakes\">vegan crab cakes</a>, these recipes will definitely satisfy your taste buds and will have you coming back for more. So let's eat green, it's now or never!",
