            "description": "Cutting beef from your diet doesn't mean you need to sacrifice your favorite comfort foods. If you're craving a good burger or bolognese sauce, we've got you covered! These meat-free recipes will show you the best way to replace beef and treat yourself the vegetarian way. You'll find classics like <a href=\"https://tasty.co/recipe/the-best-ever-vegan-burger\">black bean vegan burgers</a> and <a href=\"https://tasty.co/recipe/one-pot-lentil-bolognese\">lentil-based bolognese sauce</a> — and none of them will take you more than 30 minutes to make.",
