            "aspect_ratio": "1:1",
            "country": "US",
            "description": "Looking for ways to spice up your next dinner party? We have an answer: bolognese. Recipes like <a href=\"https://tasty.co/recipe/creamy-sausage-bolognese\">Creamy Sausage Bolognese</a> and <a href=\"https://tasty.co/recipe/summertime-lentil-bolognese\">Summertime Lentil Bolognese</a> are tasty, versatile, and protein-rich. The best part? All of ours are crowd-pleasers and easy as pie (or should we say, pasta)? Pair them with plenty of vegetables or your pasta of choice, and let the compliments flood in.",
