    "instructions": [
      {
        "position": 1,
        "display_text": "Boil water and add in the banana peel. Cook for 10 minutes or until soft . In a separate bowl, mix the oats and milk",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67581
      },
      {
        "temperature": null,
        "id": 67582,
        "position": 2,
        "display_text": "Add in half of the banana and mash it all together Then, add in your protein powder, cinnamon, nutmeg and maple syrup and stir",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67583,
        "position": 3,
        "display_text": "Remove the banana peel from the boiling water, drain the water and tear the peel up into pieces and add it to the pancake mixture"
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67584,
        "position": 4,
        "display_text": "Mix the peel in and let it break up further until you can no longer see many bits. Then, add your berries to the mixture."
      },
      {
        "display_text": "Cook the pancakes on medium heat on a pan for 3-4 minutes on each side, until each side is crispy and light golden brown. You can separate the mixture into 4 or 5 mini pancakes or make a large one. However, you will need to cook this for longer on each side.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67585,
        "position": 5
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67586,
        "position": 6,
        "display_text": "Remove from the pan and assemble on a plate with all your favorite toppings."
      },
      {
        "id": 67587,
        "position": 7,
        "display_text": "Cut up the remaining half of the banana and place the pieces on top. Serve warm.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null
      }
    ],
