    "canonical_id": "recipe:7722",
    "instructions": [
      {
        "start_time": 18000,
        "appliance": null,
        "end_time": 41000,
        "temperature": null,
        "id": 67516,
        "position": 1,
        "display_text": "Start by glazing your tofu.  In a mixing bowl combine the olive oil, soy sauce, sesame oil, fish sauce, sriracha, honey, and lime juice. Then toss in the cubed tofu and coat to cover each piece. Allow to sit in the glaze for at least 30 minutes."
      },
      {
        "end_time": 61000,
        "temperature": null,
        "id": 67519,
        "position": 2,
        "display_text": "Next, assemble the glazed tofu cubes evenly onto skewers.  Preheat your greased grill to medium high, then place the tofu skewers on. Cook for 6-8 minutes, turning as needed, then set aside.",
        "start_time": 41000,
        "appliance": null
      },
      {
        "temperature": null,
        "id": 67517,
        "position": 3,
        "display_text": "To assemble the salad, place the rice noodles in a large mixing bowl.  Top with the olive oil, soy sauce, sesame oil, fish sauce, sriracha, honey, and lime juice. Toss the noodles to coat.",
        "start_time": 64000,
        "appliance": null,
        "end_time": 83000
      },
      {
        "temperature": null,
        "id": 67521,
        "position": 4,
        "display_text": "Next, top with the sesame seeds, red pepper, cucumbers, green onions, and carrot. Toss again to coat evenly.",
        "start_time": 83001,
        "appliance": null,
        "end_time": 95423
      },
      {
        "start_time": 95424,
        "appliance": null,
        "end_time": 107846,
        "temperature": null,
        "id": 67520,
        "position": 5,
        "display_text": "Transfer to a serving platter, then shingle the sliced avocado on top.  To finish, place the skewers of miso-glazed tofu on top of the noodle salad and serve with extra limes for squeezing."
      },
      {
        "start_time": 110000,
        "appliance": null,
        "end_time": 116166,
        "temperature": null,
        "id": 67518,
        "position": 6,
        "display_text": "Enjoy!"
      }
    ],
