    "num_servings": 4,
    "description": "Mofongo is a traditional Puerto Rican dish that consists of mashed fried green plantains, fresh garlic, adobo seasoning, and olive oil, served in a mound shape with a warm broth or sauce for dipping. Mofongo is super versatile, as it can be made in many different forms and is tasty no matter what it's paired with. Here, Jeremie Serrano shows us how to make a vegan version of mofongo and caldo with a zesty mojo sauce for topping.",
    "show_id": 17,
    "buzz_id": null,
    "approved_at": 1629129744,
    "seo_title": "",
    "video_id": null,
    "instructions": [
      {
        "display_text": "Make the caldo de “pollo”: In a large pot, melt the vegan butter over medium-high heat. Add the onion and garlic paste and sauté until fragrant, 2–3 minutes. Add the vegetable stock and bouillon cube and bring to a boil. Once the bouillon cube has dissolved, reduce the heat to low, add the bay leaves, and season with salt and the pepper. Simmer for 15–20 minutes, until the flavors marry.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67377,
        "position": 1
      },
      {
        "end_time": 0,
        "temperature": null,
        "id": 67378,
        "position": 2,
        "display_text": "Meanwhile, make the mojo: Dice the onion and red and green bell pepper. Transfer to a medium container with a lid and add the garlic paste, cilantro, and olive oil and season with salt and pepper. Stir to combine. Cover and refrigerate until ready to serve.",
        "start_time": 0,
        "appliance": null
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67379,
        "position": 3,
        "display_text": "Make the mofongo: In a large, high-walled pan, heat the oil over medium-high heat until shimmering. Working in batches, add the plantain pieces to the hot oil and fry for 3–4 minutes, until golden brown on all sides. Transfer to a paper towel-lined plate to drain."
      },
      {
        "id": 67380,
        "position": 4,
        "display_text": "Add a few pieces of fried plantain, some vegan butter, and garlic paste, to a mortar. Mash with the pestle until smooth, adding 1 tablespoon at a time of the caldo until the desired consistency is reached. Season to taste with adobo seasoning. Repeat with the remaining plantains.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null
      },
      {
        "display_text": "Use your hands or rubber spatula to shape the mofongo into roughly 1-cup mounds.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67381,
        "position": 5
      },
      {
        "display_text": "Top the mofongo with the mojo and serve immediately with the hot caldo alongside.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67382,
        "position": 6
      },
      {
        "temperature": null,
        "id": 67383,
        "position": 7,
        "display_text": "Enjoy!",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      }
    ],
