        "instructions": [
          {
            "temperature": null,
            "id": 34000,
            "position": 1,
            "display_text": "In a large pan, heat 2 tablespoons of olive oil over medium heat.",
            "start_time": 5000,
            "appliance": null,
            "end_time": 7000
          },
          {
            "appliance": null,
            "end_time": 10666,
            "temperature": null,
            "id": 34001,
            "position": 2,
            "display_text": "Add the onion and sauté for about 3 minutes until translucent.",
            "start_time": 7333
          },
          {
            "position": 3,
            "display_text": "Add the garlic and cook for about 2 minutes, until fragrant.",
            "start_time": 10833,
            "appliance": null,
            "end_time": 13833,
            "temperature": null,
            "id": 34002
          },
          {
            "display_text": "Add the green pepper. Stir and sauté for about 5 minutes until tender.",
            "start_time": 14000,
            "appliance": null,
            "end_time": 20666,
            "temperature": null,
            "id": 34003,
            "position": 4
          },
          {
            "start_time": 21000,
            "appliance": null,
            "end_time": 24500,
            "temperature": null,
            "id": 34004,
            "position": 5,
            "display_text": "Transfer the sautéed vegetables to a bowl and set aside."
          },
          {
            "end_time": 29166,
            "temperature": null,
            "id": 34005,
            "position": 6,
            "display_text": "Melt the vegan butter in the pan.",
            "start_time": 25000,
            "appliance": null
          },
          {
            "position": 7,
            "display_text": "Add the mushrooms and stir to coat in the butter.",
            "start_time": 29000,
            "appliance": null,
            "end_time": 33666,
            "temperature": null,
            "id": 34006
          },
          {
            "display_text": "Add the paprika, ¼ teaspoon onion powder,  ¼ teaspoon garlic powder, ½ teaspoon black pepper, and ½ teaspoon salt. Stir well. Sauté for about 7 minutes until the mushrooms are dark brown and reduce in size by half.",
            "start_time": 33667,
            "appliance": null,
            "end_time": 45483,
            "temperature": null,
            "id": 34007,
            "position": 8
          },
          {
            "appliance": null,
            "end_time": 49000,
            "temperature": null,
            "id": 34008,
            "position": 9,
            "display_text": "Add the green pepper, onion, and garlic mixture back to the pan and stir.",
            "start_time": 45000
          },
          {
            "appliance": null,
            "end_time": 56000,
            "temperature": null,
            "id": 34009,
            "position": 10,
            "display_text": "Add the soy sauce and Worcestershire sauce. Stir well. Continue to sauté for about 7 minutes until the liquid has thickened.",
            "start_time": 49000
          },
          {
            "start_time": 56333,
            "appliance": null,
            "end_time": 77816,
            "temperature": null,
            "id": 34010,
            "position": 11,
            "display_text": "In the meantime, place the carrot, vegetable broth, remaining 3 tablespoons of olive oil, the lemon juice, nutritional yeast, remaining teaspoon of onion powder, remaining teaspoon of garlic powder, the tomato paste, remaining ½ teaspoon of salt, and remaining ½ teaspoon of pepper in a food processor. Blend until it forms a smooth and homogenous sauce."
          },
          {
            "id": 34011,
            "position": 12,
            "display_text": "Add the potato and blend until homogenous.",
            "start_time": 78000,
            "appliance": null,
            "end_time": 85000,
            "temperature": null
          },
          {
            "start_time": 86000,
            "appliance": null,
            "end_time": 92833,
            "temperature": null,
            "id": 34012,
            "position": 13,
            "display_text": "Fill the hoagies with the mushroom mixture."
          },
          {
            "start_time": 93000,
            "appliance": null,
            "end_time": 99500,
            "temperature": null,
            "id": 34013,
            "position": 14,
            "display_text": "Top the mushroom mixture with the vegan “cheese”, and parsley. Serve immediately."
          },
          {
            "temperature": null,
            "id": 34015,
            "position": 15,
            "display_text": "Enjoy!",
            "start_time": 100000,
            "appliance": null,
            "end_time": 103833
          }
        ],
