        "seo_title": "",
        "instructions": [
          {
            "display_text": "Preheat the oven to 425°F (220°C).",
            "start_time": 0,
            "appliance": "oven",
            "end_time": 0,
            "temperature": 425,
            "id": 49286,
            "position": 1
          },
          {
            "temperature": null,
            "id": 49287,
            "position": 2,
            "display_text": "Bring a small pot of water to a boil. Add the cashews and boil for 10 minutes, until fork-tender. Drain, reserving 1 cup (240 ML) plus 2 tablespoons of the cooking water.",
            "start_time": 1999,
            "appliance": null,
            "end_time": 7150
          },
          {
            "position": 3,
            "display_text": "In a blender, combine the boiled cashews, nutritional yeast, tapioca starch, lemon juice, garlic powder, salt, and reserved cooking water.  Blend on high speed until completely smooth with no grittiness.",
            "start_time": 8316,
            "appliance": null,
            "end_time": 24966,
            "temperature": null,
            "id": 49288
          },
          {
            "appliance": null,
            "end_time": 40283,
            "temperature": null,
            "id": 49289,
            "position": 4,
            "display_text": "Pour the cashew mixture into a small pot. Cook over low heat, stirring continuously, until the sauce thickens, about 5-7 minutes. Once the sauce is stretching and pulls away from the sides of the pot, remove from the heat.",
            "start_time": 26466
          },
          {
            "start_time": 0,
            "appliance": null,
            "end_time": 0,
            "temperature": null,
            "id": 49290,
            "position": 5,
            "display_text": "Use your hands to stretch the pizza dough into a circle about 14 inches (35 cm) in diameter and ½-inch (1 ¼ cm) thick. Lay on a sheet of parchment paper."
          },
          {
            "start_time": 42000,
            "appliance": null,
            "end_time": 53500,
            "temperature": null,
            "id": 49291,
            "position": 6,
            "display_text": "Spread the marinara sauce over the pizza dough in an even layer. Use an ice cream scoop to dollop the cashew mozzarella on top."
          },
          {
            "temperature": null,
            "id": 49292,
            "position": 7,
            "display_text": "Bake for 14-16 minutes, until the crust is lightly golden around the edges.",
            "start_time": 0,
            "appliance": null,
            "end_time": 0
          },
          {
            "start_time": 58000,
            "appliance": null,
            "end_time": 66333,
            "temperature": null,
            "id": 49293,
            "position": 8,
            "display_text": "Remove from oven and top with the basil. Cut into 8 slices and serve."
          },
          {
            "position": 9,
            "display_text": "Enjoy!",
            "start_time": 68000,
            "appliance": null,
            "end_time": 71833,
            "temperature": null,
            "id": 49294
          }
        ],
