    "instructions": [
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67321,
        "position": 1,
        "display_text": "Pour 300 ml water in a mixing bowl, then mix with 100g mung bean starch. Stir until combined well (no lumps).",
        "start_time": 0
      },
      {
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67322,
        "position": 2,
        "display_text": "Pour the remaining 600 ml of water into a saucepan and heat water to 60°C (140 f). Start pouring mixture into water, whisking constantly.",
        "start_time": 0
      },
      {
        "temperature": null,
        "id": 67323,
        "position": 3,
        "display_text": "Cook the mixture on low heat until the color becomes transparent, then remove from heat. Then, pour the mixture into a lightly-greased mould and set aside in a fridge or at room temperature for a few hours or until set.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67324,
        "position": 4,
        "display_text": "To make the dressing, mix together light soy sauce, black vinegar, and water until combined. Then add homemade chili oil, ground Sichuan pepper, sesame oil, crushed garlic and salt."
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67325,
        "position": 5,
        "display_text": "When the jelly noodle is completely set and flip it over onto a cutting board. Cut the noodles into a desired shape and size."
      },
      {
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null,
        "id": 67326,
        "position": 6,
        "display_text": "Place carrot, cucumber and avocado on the top of the salad and drizzle with salad dressing."
      },
      {
        "id": 67327,
        "position": 7,
        "display_text": "Garnish with sesame seeds and fresh herbs and serve.",
        "start_time": 0,
        "appliance": null,
        "end_time": 0,
        "temperature": null
      }
    ],
